impl Solution {
    pub fn last_visited_integers(words: Vec<String>) -> Vec<i32> {
        let mut last_visited = Vec::new(); // To store the last visited integers
        let mut nums = Vec::new(); // To keep track of the integers seen so far
        let mut prev_count = 0; // To count consecutive "prev" strings

        for word in words {
            if word == "prev" {
                prev_count += 1; // Increment count for consecutive "prev"

                // Check if prev_count exceeds the length of nums
                if prev_count > nums.len() {
                    last_visited.push(-1); // Push -1 if there are no enough integers visited
                } else {
                    // Otherwise, push the corresponding last visited integer
                    last_visited.push(nums[nums.len() - prev_count]);
                }
            } else {
                // Reset prev_count when an integer is encountered
                prev_count = 0;
                // Convert word to integer and push to nums
                if let Ok(num) = word.parse::<i32>() {
                    nums.push(num);
                }
            }
        }

        last_visited
    }
}
